import React, { Component } from 'react'

import NavBar from './NavBar/NavBar'

class Header extends Component {

    render() {
        return(
        <div>
            <h1>ryan slevin</h1>
            <NavBar handlePageChange={this.props.handlePageChange}/>
        </div>
        )

    }

}

export default Header;
